    mapping unit of 2 hectares. Categories: 1, T.1.A.9.b.I, Pinus echinata, shortleaf
    pine 2, T.1.A.9.b.II, Pinus taeda, loblolly pine 3, T.1.A.9.c.I, Juniperus virginiana,
